PRAGMA foreign_keys = off;
BEGIN TRANSACTION;

-- Table: MEDICAMENTOS
CREATE TABLE MEDICAMENTOS (DCB INTEGER PRIMARY KEY, PRINCIPIO_ATIVO TEXT, UNID_MEDIDA TEXT, QTD_ATIVO_UNID_FARMA DECIMAL, TIPO_UNID_FARMA TEXT);

-- Table: PESSOA
CREATE TABLE PESSOA (IDVENDAS INTEGER REFERENCES VENDAS (IDVENDAS), SEXO INTEGER, IDADE INTEGER, UNID_IDADE INTEGER);

-- Table: PRESCRITOR
CREATE TABLE PRESCRITOR (CONSELHO TEXT, UF TEXT);

-- Table: PRESCRITORVENDA
CREATE TABLE PRESCRITORVENDA (IDVENDAS INTEGER REFERENCES VENDAS (IDVENDAS), CONSELHO TEXT, UF TEXT);

-- Table: VENDAS
CREATE TABLE VENDAS (IDVENDAS INTEGER PRIMARY KEY, ANO INTEGER, MES INTEGER, UF TEXT, MUNICIPIO TEXT, DCB INTEGER REFERENCES MEDICAMENTOS (DCB), QTD_UNID_FARMA INTEGER, RECEITUARIO INTEGER);

COMMIT TRANSACTION;
PRAGMA foreign_keys = on;
